import React from "react";
import TopNavbar from "./components/TopNavbar";
import Navbar from "./components/Navbar";
import Home from "./pages/Home";

function App() {
  return (
    <div>
      <TopNavbar />
      <Navbar />
      <Home />
    </div>
  );
}

export default App;
